import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import {Link} from "react-router-dom";
import Particles from 'react-particles-js';
import './index.css'

export default class Homepage extends Component {
  render() {
  return (
      <div className="Homepage">
        <div className="Social">
            <a href="https://www.github.com/phoenixtahoe"><i className="fa fab fa-github"></i></a>
            <a href="https://linkedin.com"><i className="fa fab fa-linkedin"></i></a>
        </div>
        <Particles style={{position: "fixed", width: "100%"}} params={{particles: {number: {value: 50}}}}/>
          <div className="Landing">
            <h1><strong>Phoenix the kid!</strong></h1>
              <div className="bird-wrapper">
                <a href="https://www.soundcloud.com/uwillbemissed"><img className="bird-img" src={require('./Gang.svg')}/></a>
              </div>
          </div>
                <i className="fa fa-code"/>
            <h1><strong>fulltime dirty sprite!</strong></h1>
                <i className="fa fa-code"/>
          <div>
            <div className="cards-wrap">
              <div className="card"><p className="name"><strong>Fractol!</strong></p></div>
              <div className="card"><p className="name"><strong>Wolf3d!</strong></p></div>
              <div className="card"><p className="name"><strong>PrintF!</strong></p></div>
            </div>
          </div>
      </div>
    );
  }
}
